import React, { Component } from 'react'
import './TextFieldComp.css'


class TextFieldComp extends Component {
    constructor(props) {
        super(props)

        this.state = {
            fileName: 'fileName',
            fileText: '',
            holdFileText: false
        }
    }

    componentDidMount() {
        this.setState({
            fileText: this.props.fileText,
            holdFileText: true
        })
    }

    render() {

        return (
            <div>
                <h1>{this.state.fileName}</h1>
                <p>{this.state.fileText}</p>
            </div>
        );
    }
}
export default TextFieldComp;
